"original": |2-
     The Session general-header field identifies an RTSP session.  An RTSP
     session is created by the server as a result of a successful SETUP
     request, and in the response, the session identifier is given to the
     client.  The RTSP session exists until destroyed by a TEARDOWN or a
     REDIRECT or is timed out by the server.
"fixed": |-
  The Session general-header field identifies an RTSP session.  An RTSP session is created by the server as a result of a successful SETUP request, and in the response, the session identifier is given to the client.  The RTSP session exists until destroyed by a TEARDOWN or a REDIRECT or is timed out by the server.
"ko": |-
  세션 일반 헤더 필드는 RTSP 세션을 식별합니다. 성공적인 SETUP 요청의 결과로 서버에서 RTSP 세션이 생성되고, 응답으로 세션 식별자가 클라이언트에 제공됩니다. RTSP 세션은 TEARDOWN 또는 REDIRECT에 의해 파괴되거나 서버에 의해 시간 초과될 때까지 존재합니다.
